        <div class="item item3 statement" id="statement">
          Bitte logge dich auf dem Minecraftserver ein und trage danach deinen
          Spielername in das Feld ein, um mit dem Login fortzufahren. <br />Du
          brauchst während des Loginvorgangs keinerlei weitern Daten, wie z.B.
          eine E-Mail Adresse oder ähnliches einzugegeben.
        </div>

        <div
          class="item item4 username-input-wrapper"
          id="username-input-wrapper"
        >
          <input
            class="username-input"
            placeholder="Username"
            type="text"
            name="username-input"
            id="username-input"
          />
        </div>

        <div
          class="item item5 password-input-wrapper"
          id="password-input-wrapper"
        >
          <input
            class="password-input"
            placeholder="Pin"
            type="text"
            name="password-input"
            id="password-input"
            maxlength="6"
            oninput="this.value = this.value.replace(/[^0-9.]/g, '').replace(/(\..*?)\..*/g, '$1');"
          />
        </div>

        <div class="item item6 login-btn-wrapper">
          <button class="login-btn" id="login-btn" onclick="clicked()">
            Weiter
          </button>
        </div>
      </div>
    </div>
    <script>
      document
        .getElementById("username-input")
        .addEventListener("keydown", function (event) {
          if (event.keyCode === 13) {
            clicked();
          }
        });
      document
        .getElementById("password-input")
        .addEventListener("keydown", function (event) {
          if (event.keyCode === 13) {
            clicked();
          }
        });

      function clicked() {
        var button = document.getElementById("login-btn");
        if (button.innerText == "Weiter") {
          if (document.getElementById("username-input").value == "") {
            return;
          }
          send_fetch(document.getElementById("username-input").value, null)
            .then((result) => {
              document
                .getElementById("container")
                .classList.add("extended-container");
              document.getElementById("username-input").disabled = true;
              button.innerText = "Bestätigen";
              document.getElementById("statement").innerText =
                "Du hast jetzt im Spiel eine Nachricht mit einer sechsstelliger Pin erhalten. Gebe jetzt diese Pin in das untenstehende Feld ein und drücke auf Bestätigen, um den Login abzuschließen.";
            })
            .catch((error) => {
              console.error(error); // handle the error
            });
        } else {
          send_fetch(null, document.getElementById("password-input").value)
            .then((result) => {
              const urlParams = new URLSearchParams(window.location.search);
              const nextParam = urlParams.get("next");

              // Redirect to the URL with the "next" parameter
              if (nextParam) {
                window.location.href = nextParam;
              } else {
                // If there is no "next" parameter, you can redirect to a default URL
                window.location.href = "/";
              }
            })
            .catch((error) => {
              console.error(error); // handle the error
            });
        }
      }

      function send_fetch(username, pin) {
        return new Promise((resolve, reject) => {
          fetch("/api/login", {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify({
              username: username,
              pin: pin,
            }),
          })
            .then((res) => res.json())
            .then((data) => {
              console.log(data);
              if (data["status"] == "success") {
                resolve(true);
              } else {
                messagebox_info(
                  data["response"],
                  data["info"],
                  { confirmationButton: "OK" },
                  {confirmationCallback: reload, confirmationParams: [data["status"]]}
                );
                if (data["status"] == "reset") {
                 // window.location.reload();
                }
                reject(false);
              }
            })
            .catch((error) => {
              messagebox_error(
                data["response"],
                data["info"],
                { confirmationButton: "OK" },
                {confirmationCallback: reload, confirmationParams: ["reset"]}
              );
              console.log("ERROR", error);
              reject(false);
            });
        });
      }

      // check to see whether the user already had a try_login cookie and load username
      var button = document.getElementById("login-btn");
      var uuid = "{{uuid}}";
      if (uuid != "") {
        console.log("Set to name: " + uuid);
        document
          .getElementById("container")
          .classList.add("extended-container");
        document.getElementById("username-input").value = uuid;
        document.getElementById("username-input").disabled = true;
        button.innerText = "Bestätigen";
        document.getElementById("statement").innerText =
          "Du hast jetzt im Spiel eine Nachricht mit einer sechsstelliger Pin erhalten. Gebe jetzt diese Pin in das untenstehende Feld ein und drücke auf Bestätigen, um den Login abzuschließen.";
      }

      function reload(status) {
        if (status == "reset") {
        window.location.reload();
      }}
    </script>
  </body>
</html>
